import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import { NavLink } from "react-router-dom";
import Logo from "./logo.png";
import { sizing } from "@material-ui/system";

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  navSpace: {
    padding: theme.spacing(2),
    width: "256px",
    textAlign: "center"
  },
  nl: {
    color: "#f0f0f0",
    textDecoration: "none",
    textTransform: "uppercase",
    letterSpacing: theme.spacing(0.5)
  }
}));

export default function ButtonAppBar() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static">
        <Toolbar disableGutters={true}>
          <Grid container>
            <Grid item={true} xl={2}>
              <Typography
                color="textPrimary"
                variant="h6"
                className={classes.navSpace}
                style={{ backgroundColor: "#ee1515" }}
              >
                <NavLink to="/" className={classes.nl}>
                  Home
                </NavLink>
              </Typography>
            </Grid>
            <Grid item={true} xl={2}>
              <Typography
                variant="h6"
                className={classes.navSpace}
                style={{ backgroundColor: "#ee1515" }}
              >
                <NavLink to="/PokeList" className={classes.nl}>
                  PokeList
                </NavLink>
              </Typography>
            </Grid>
            <Grid item={true} xl={2}>
              <Typography
                variant="h6"
                className={classes.navSpace}
                style={{ backgroundColor: "#222224" }}
              >
                <NavLink to="/Type" className={classes.nl}>
                  By Type
                </NavLink>
              </Typography>
            </Grid>
            <Grid item={true} xl={1} className={classes.navSpace}></Grid>
            <Grid item={true} xl={5} className={classes.navSpace}>
              <img width="auto" src={Logo} alt="PokeFind" />
            </Grid>
          </Grid>
        </Toolbar>
      </AppBar>
    </div>
  );
}
